today, one year ago, i did not stand alone... i stood with hundreds of thousands of women & men, girls & boys, dogs & horses, fighting for our human rights, education, gender equality...such a wonderful experience walking side by side with a gigantic group of people, all as one. it really was a peaceful, fun, energetic, and powerful experience! it feels great to speak up, to be heard. "i am a #feminist ! i stand up for both #men, #women, & #animals! i #speakup for everyone that cannot be heard! i will #standup for anyone that is held! #equality is for everyone, everywhere, all the time. i do this because #timesup for injustice, racism, war, hatred... #imarched today, and it felt so good to stand up for all girls, all boys, all men & women... and most importantly, for #metoo. because i also want to live in a world where i can be safely myself."- @montsefreg97 
@stand4changesdg 
#womensmarch2018 #proud #likeagirl #rebelgirl #genderequality #globalgoals #humanrights #womensmarch2019 #marchforourlives 
@womensmarch @rebelgirlsbook @emmawatson @unwomen

